import React from 'react'
import styled from 'styled-components'
import {
  Switch,
  Route,
  Link
} from "react-router-dom";

const Alldiv = styled.div`
width : 100%;
height : 65vh;
border : solid 1px white;

`


function Inforoutediv() {
  return (
    <div>
      <Alldiv>

        <Switch>
          <Route path = "/Last">
            <h1 style = {{color: "white"}}>Last</h1>
          </Route>

          <Route path = "/Find">
            <h1 style = {{color: "white"}}>Find</h1>
          </Route>

          <Route path = "/Create">
            <h1 style = {{color: "white"}}>Create</h1>
          </Route>
        </Switch>

      </Alldiv>



    </div>
  )
}

export default Inforoutediv
